import React from 'react';
import { AppBar, Toolbar, Button, Typography, Box, Container } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import DirectionsCarIcon from '@mui/icons-material/DirectionsCar';

const Navbar = () => {
  const navigate = useNavigate();

  return (
    <AppBar position="sticky" sx={{ backgroundColor: 'white', boxShadow: 1 }}>
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <Box sx={{ display: 'flex', alignItems: 'center', cursor: 'pointer' }} onClick={() => navigate('/')}>
            <DirectionsCarIcon sx={{ color: 'primary.main', fontSize: 40, mr: 1 }} />
            <Typography
              variant="h6"
              noWrap
              sx={{
                fontFamily: 'monospace',
                fontWeight: 700,
                letterSpacing: '.3rem',
                color: 'secondary.main',
                textDecoration: 'none',
              }}
            >
              CAR PRIME
            </Typography>
          </Box>

          <Box sx={{ flexGrow: 1, display: 'flex', justifyContent: 'center', gap: 2 }}>
            <Button
              onClick={() => navigate('/')}
              sx={{ color: 'secondary.main', '&:hover': { color: 'primary.main' } }}
            >
              Home
            </Button>
            <Button
              onClick={() => navigate('/bookings')}
              sx={{ color: 'secondary.main', '&:hover': { color: 'primary.main' } }}
            >
              Bookings
            </Button>
            <Button
              onClick={() => navigate('/wishlist')}
              sx={{ color: 'secondary.main', '&:hover': { color: 'primary.main' } }}
            >
              Wishlist
            </Button>
            <Button
              onClick={() => navigate('/orders')}
              sx={{ color: 'secondary.main', '&:hover': { color: 'primary.main' } }}
            >
              Orders
            </Button>
          </Box>

          <Box sx={{ display: 'flex', gap: 2 }}>
            <Button
              variant="outlined"
              onClick={() => navigate('/login')}
              sx={{
                color: 'primary.main',
                borderColor: 'primary.main',
                '&:hover': { borderColor: 'primary.main', backgroundColor: 'primary.main', color: 'white' },
              }}
            >
              Login
            </Button>
            <Button
              variant="contained"
              onClick={() => navigate('/signup')}
              sx={{
                backgroundColor: 'primary.main',
                color: 'white',
                '&:hover': { backgroundColor: 'primary.dark' },
              }}
            >
              Sign Up
            </Button>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default Navbar;
